import React, { Component } from 'react';



class Filter extends Component {

	render(){
		return(
	     	<div>
	     		<div>
		     		<h6>Filter 486 Items</h6>
		     		<h6>Gender</h6>
		     		<h6>Category</h6>
	     		</div>

	     		<div>
	     			<h6>Color</h6>
	     		</div>

	     		<div>
	     			<h6>Size</h6>
	     		</div>

	     		<div>
	     			<h6>Price Range</h6>
	     		</div>

	     		<div>
	     			<h6>Brand</h6>
	     		</div>

	     	</div>
		);
	}
}





export default Filter;
